import React from 'react';
import ReactDom from 'react-dom';

function Greeting() {
  return (
    <div>
      <h1>Hey</h1>
      <ul>
        <li>
          <a href='#'>Hello World</a>
        </li>
      </ul>
    </div>
  );
}

